import React from "react";

const BrowserViewInfo = () => {
  return (
    <div>
      <h1>Sorry, This URL is not allowed to be accessed via desktop device.</h1>
      <h1>Please retry with mobile device</h1>
    </div>
  );
};

export default BrowserViewInfo;
